import React, {useEffect} from 'react';
import {useNavigate} from 'react-router-dom'
const Chat = () => {
  const navigate = useNavigate()
  useEffect(() => {
    if (!localStorage.token) {
      navigate('/login')  
    }
  }, [navigate]);
  return (
    <div>
      <h1>Ovewview chat</h1>
    </div>
  );
}

export default Chat;
